$(function() {

    $('#fullpage').fullpage({
        fadingEffect: true,
        anchors: ['01', '02', '03'],
        navigation: true,
        navigationPosition: 'left',
    });

    $('#arrow-down').click(function(){
        $.fn.fullpage.moveSectionDown();
    });

    $('audio,video').mediaelementplayer();

    $('#cunsomer-likes .blog-posts').masonry({
        itemSelector: '.blog-post-item'
    });

    $('#cunsomer-search .blog-posts').masonry({
        itemSelector: '.blog-post-item'
    });

    new Chart(document.getElementById("bar-chart"), {
        type: 'bar',
        data: {
            labels: ["Mar 4", "Mar 5", "Mar 6", "Mar 7", "Mar 8", "Mar 9", "Mar 10"],
            datasets: [
                {
                    backgroundColor: ["#8bb5ff", "#8bb5ff", "#8bb5ff", "#8bb5ff", "#8bb5ff", "#8bb5ff", "#8bb5ff"],
                    data: [50, 20, 12, 50, 11, 4, 9]
                },
            ]
        },
        options: {
            legend: { display: false },
            scales: {
                yAxes: [
                    {
                        ticks: {
                            stepSize: 10
                        }
                    }
                ]
            }
        }
    });
});